// DEP.
import React, { Component } from 'react'
import { NavLink } from 'react-router-dom';

// CSS
import '../css/App.css'
import '../css/Resume.css'
import WOW from 'wowjs';

export default class Footer extends Component {

    state = {

        active: false

    }

    toGitHub = () => {

        window.location.href = 'https://github.com/MaxGunter99'

    };

    toLinkedIn = () => {

        window.location.href = 'https://www.linkedin.com/in/michael-gunter-5383a0181/'

    };

    toEmail = () => {

        window.location.href = "mailto:Michael.Alex.Gunter@gmail.com";

    };

    componentDidMount() {

        new WOW.WOW().init();

    };

    render() {

        return (

            <footer>

                <div className='Pages'>

                    {/* <h1>M.G.</h1> */}
                    <p>Pages</p>

                    {window.location.href.split('/')[3] === '' ?

                        <>
                            <NavLink exact to='/Interests'>Interests</NavLink>
                            <NavLink exact to='/Resume'>Resume</NavLink>
                            {/* <p>Contact Me</p> */}
                        </>

                    : window.location.href.split('/')[3] === 'Interests' ?

                        <>
                            <NavLink exact to='/'>Skills</NavLink>
                            <NavLink exact to='/Resume'>Resume</NavLink>
                            {/* <p>Contact Me</p> */}
                        </>

                    : window.location.href.split('/')[3] === 'Resume' ?

                        <>
                            <NavLink exact to='/'>Skills</NavLink>
                            <NavLink exact to='/Interests'>Interests</NavLink>
                            {/* <p>Contact Me</p> */}
                        </>

                    : null }

                </div>

                <div className = 'CMFooter'>

                    <h3>Contact Me:</h3>
                    <img src={GitHub} alt='CImage' className={set} data-wow-duration="1s" onClick={ () => this.toGitHub() } />
                    <img src={LinkedIn} alt='CImage' className={set} data-wow-duration="1s" onClick={ () => this.toLinkedIn() } />
                    <img src={Email} alt='CImage' className={set} data-wow-duration="1s" onClick={ () => this.toEmail() } />
                </div>

            </footer>

        )
    }
}
